import React from "react";
import { NavLink } from "react-router-dom";
import './Navbar.css'


const Navbar = () => {
  let navbar = ["Home","SignUp", "SignIn"];
  
//   function signout(){

//     console.log("user loged out");
    
 
//   }

    
function select(el) {
	document.querySelector(".navsearch").classList.remove("active")
	document.querySelector(".active").classList.remove("active")
	
	el.classList.add("active")
	
	document.body.style.setProperty('--activeclr', el.dataset.clr);
}
function selectsearch() {
	console.log("select")
	const el = document.querySelector(".navsearch")
	el.classList.toggle("active")
	if (el.classList.contains("active")) {
		document.querySelector(".searchbox").focus()
	}
}

  
  
  return (
    // <div classNameName=" p-9 font-bold">
    //   <nav classNameName="flex align-center justify-between p-3">
    //     <div classNameName="mx-70 align-center flex object-contain">
    //      <div classNameName="flex"> 
    //       <h1 classNameName="text-center text-black text-6xl px-2 py-2 font-vibefont">VibeCheck</h1></div>
    //     </div>
    //     <ul classNameName="flex justify-center items-center">
    //       {navbar.map((buttons, index) => (
    //         <NavLink to={buttons} key={index} classNameName=" text-black mx-9 text-xl rounded-full p-2 text-center hover: curosr-pointer link hover:text-sky-400">{buttons}</NavLink> 
    //       ))}
    //     </ul>
    //   </nav>
    // </div>

    <div className="wrapper">
	<div className="navbar">
		<a href="#" className="navitem active" onclick="select(this)" data-clr="#e4ecfa">
			<div className="indicator"></div>
			<div className="hoverindicator"></div>
			<ion-icon name="home"></ion-icon>
		</a>
		<a href="#" className="navitem" onclick="select(this)" data-clr="#fff6cc">
			<div className="indicator"></div>
			<div className="hoverindicator"></div>
			<ion-icon name="person"></ion-icon>
		</a>
		<div className="navsearch">
			<input className="searchbox"></input>
			<div className="searchicon" onclick="selectsearch()">
				<ion-icon name="search"></ion-icon>
			</div>
		</div>
		<a href="#" className="navitem" onclick="select(this)" data-clr="#f0e4fa">
			<div className="indicator"></div>
			<div className="hoverindicator"></div>
			<ion-icon name="cog"></ion-icon>
		</a>
	</div>
</div>
  );
};

export default Navbar;
